// Imports
import React from "react";



// The Expense function...
function Expense() {



  // The addExpense function ...
  function addExpense() {
      alert("Add Expense button clicked");
  }



  // The deleteExpense function ...
  function deleteExpense() {
      alert("Delete Expense button clicked");
  }

  return (
    <div className="section add-expense">
        <h3>Add Expense</h3>
        <form className="create-expense">
          <input
            name="title"
            placeholder="Expense Title"
          />
          <textarea
            name="description"
            placeholder="Description of expense (optional)"
            rows={3}
          />
          <button onClick={addExpense}>Add</button>
        </form>

        <button onClick={deleteExpense}>Delete</button>
    </div>
  );
}



// Export function
export default Expense;
